description:
Rory just graduated from culinary school but she's too broke to pay for her school debt! She then has the idea to open a small restaurant for her own, to pay her debts!
Enter the idea of Rory's Restaurant: An amazing mix of Match 3 - cooking game!

This game has every genres you'll love and already familiar with: Match 3, Hidden Object and Tapping minigame!
