Game features:
- Enjoy familiar Match 3 game mechanic, combined together with exciting cooking theme!
- Help Rory cook through 70 challenging levels!
- Once a week, a mean Food Critic will come to test your cooking skills!
- Rory also needs your help to clean up her messy kitchen once every two weeks! (Hidden Object minigame)
- Occasionally, Rory'll also get to serve Gelato desert to her customers! (tapping minigame)
